import { useEffect } from "react";

function UserCard() {
  useEffect(async function () {
      try{
        const responseData = await fetch("https://randomuser.me/api/");
        console.log(responseData);
      }
    catch(error){
        console.log(`error: ${error}`); 
    }
  });

  return "loading";
}

export default UserCard;
